//This function needs to be called Raid for the navbar to link to it.
import React from 'react';
import RefactoredBossCard from './refactored-boss-card/BossCard';
import Tabs from './Tabs';
import './bossPage.css';


export default function Raid() {

  return (
    <>
    <h1>Abyssal Dungeon Boss Guide</h1>
    <Tabs
        children={[
            {
                props: { label: 'Tier 1' }
            },
            {
                props: { label: 'Tier 2' }
            },
            {
                props: { label: 'Tier 3' }
            },
            {
              props: { label: 'Tier 5' }
          },
          {
              props: { label: 'Tier 6' }
          },
          {
              props: { label: 'Tier 7' }
          }
        ]}
    />

    <div className="cards">
        <div className="cards__container">
            <div className="cards__wrapper">
                <div className="cards__items">
                    <RefactoredBossCard
                        src="Lost-Ark-Images/img1.jpg"
                        text="Demon Beast Canyon"
                        label="Dungeon"
                        path="/demon-beast-canyon"
                    />
                    <RefactoredBossCard
                        src="Lost-Ark-Images/laimage1.jpg"
                        text="Necromancer's Origin"
                        label="Dungeon"
                        path="/demon-beast-canyon"
                    />
                    <RefactoredBossCard
                        src="Lost-Ark-Images/laimage1.jpg"
                        text="Necromancer's Origin"
                        label="Dungeon"
                        path="/demon-beast-canyon"
                    />
                    <RefactoredBossCard
                        src="Lost-Ark-Images/laimage1.jpg"
                        text="Necromancer's Origin"
                        label="Dungeon"
                        path="/demon-beast-canyon"
                    />
                </div>
         
            </div>
        </div>
    </div>
  
</>
  );
}
